data.text:
@Emilia26774099 @GarryConner6 I’m a conservative, fully vaxed since March.  I could care less if others decide to or not.

I had my reasons for getting it done, others have their reasons for not doing so—That’s called freedom of choice.

At its peak this virus had a mortality rate of &lt;1%, where’s the urgency?

